import styled from 'styled-components'

export const GenericButton = styled.button`
    text-decoration: none;
    border: none;
    width:80%;
    font-size: 15px;
    color:white;
    box-sizing:border-box;
    background-color:#5887F9;
    border-radius:2px;
    padding:7px;
    margin:5px 0px;

`
